        body { background-color: #0b0f1a; color: #f8fafc; font-family: 'Inter', sans-serif; }
        .glass { background: rgba(23, 32, 53, 0.8); backdrop-filter: blur(12px); border: 1px solid rgba(255,255,255,0.05); }
        .modal-bg { background: rgba(0, 0, 0, 0.9); backdrop-filter: blur(8px); }
        select { background-color: #1e293b; color: white; border: 1px solid #334155; padding: 0.5rem; border-radius: 0.5rem; outline: none; font-size: 0.85rem; width: 100%; }
        
        .user-link { color: #60a5fa; text-decoration: underline; text-underline-offset: 3px; cursor: pointer; transition: color 0.2s, opacity 0.2s; }
        .user-link:hover { color: #93c5fd; opacity: 0.8; }
        
        tr { border-bottom: 1px solid rgba(255,255,255,0.03); }
        .sort-icon { font-size: 0.7rem; margin-left: 4px; opacity: 0.5; font-family: monospace; }
        .active-sort { color: #ef4444 !important; opacity: 1 !important; }
        .stat-badge { background: rgba(255,255,255,0.03); border: 1px solid rgba(255,255,255,0.1); padding: 2px 10px; border-radius: 6px; }

        .switch { position: relative; display: inline-block; width: 48px; height: 24px; }
        .switch input { opacity: 0; width: 0; height: 0; }
        .slider { position: absolute; cursor: pointer; top: 0; left: 0; right: 0; bottom: 0; background-color: #1a1d23; transition: .3s; border-radius: 24px; border: 1px solid #334155; }
        .slider:before { position: absolute; content: ""; height: 16px; width: 16px; left: 4px; bottom: 3px; background-color: #4b5563; transition: .3s; border-radius: 50%; }
        input:checked + .slider { background-color: #d1d5db; border-color: #d1d5db; }
        input:checked + .slider:before { transform: translateX(22px); background-color: #111827; }

        /* Custom Checkbox for Table Display */
        .setting-check { display: inline-block; width: 16px; height: 16px; border-radius: 4px; border: 1px solid #334155; position: relative; vertical-align: middle; }
        .setting-check.active { background-color: #10b981; border-color: #10b981; }
        .setting-check.active::after { content: 'âœ“'; font-size: 10px; color: black; position: absolute; top: 50%; left: 50%; transform: translate(-50%, -50%); font-weight: bold; }
        .setting-check.inactive { background-color: #1e293b; opacity: 0.3; }
        
        .sortable-header { cursor: pointer; user-select: none; transition: color 0.2s; }
        .sortable-header:hover { color: #fff; }
    </style>

        let currentModalUser = "", modalSortCol = "rounds", modalSortDir = 1;

        function formatDuration(totalSeconds) {
            const n = Math.floor(parseFloat(totalSeconds));
            const mins = Math.floor(n / 60), secs = n % 60;
            return String(mins).padStart(2, '0') + ":" + String(secs).padStart(2, '0');
        }

        function getTimerLabel(val) {
            if (val === 0) return "No Limit";
            if (val === 300) return "5m";
            return val + "s";
        }

        function indexUsers() {
            for (const [key, entries] of Object.entries(rawData)) {
                const parts = key.split('_'); 
                // parts: [0]rounds, [1]timer, [2]pan, [3]zoom, [4]move
                const r = parseInt(parts[0]);
                const t = parseInt(parts[1]);
                const p = parts[2] === "true";
                const z = parts[3] === "true";
                const m = parts[4] === "true";

                entries.forEach(entry => {
                    const u = entry.username;
                    if (!userMap[u]) userMap[u] = [];
                    if (parseInt(entry.position) === 1) globalWRCount[u] = (globalWRCount[u] || 0) + 1;
                    userMap[u].push({
                        rounds: r, timer: t, pan: p, zoom: z, move: m,
                        rank: parseInt(entry.position),
                        score: parseInt(entry.score), time: parseFloat(entry.duration)
                    });
                });
            }
        }

        function updateTable() {
            const key = [
                document.getElementById('selRounds').value, document.getElementById('selTimer').value,
                document.getElementById('selPan').checked ? "true" : "false",
                document.getElementById('selZoom').checked ? "true" : "false",
                document.getElementById('selMove').checked ? "true" : "false"
            ].join('_');
            const entries = rawData[key] || [], tbody = document.getElementById('leaderboardBody');
            tbody.innerHTML = entries.length ? "" : '<tr><td colspan="4" class="p-10 text-center text-slate-600 uppercase text-xs tracking-widest">No Leaderboard Found</td></tr>';
            entries.forEach(e => {
                const wrs = globalWRCount[e.username] || 0;
                let rankStyle = "text-slate-400 font-mono";
                if(e.position === 1) rankStyle = "text-yellow-400 font-black";
                else if(e.position === 2) rankStyle = "text-slate-300 font-black";
                else if(e.position === 3) rankStyle = "text-amber-600 font-black";
                const row = document.createElement('tr');
                row.className = "hover:bg-red-500/5 transition-colors";
                row.innerHTML = `<td class="p-5 ${rankStyle}">#${e.position}</td><td class="p-5 font-bold"><span class="user-link" onclick="showUserStats('${e.username.replace(/'/g, "\'")}')">${e.username}</span>${wrs > 0 ? `<span class="text-yellow-500 ml-2 text-xs">ðŸ¥‡${wrs}</span>` : ""}</td><td class="p-5 text-center font-mono text-emerald-400 font-bold">${e.score.toLocaleString()}</td><td class="p-5 text-slate-400 font-mono">${formatDuration(e.duration)}</td>`;
                tbody.appendChild(row);
            });
        }

        function showUserStats(u) {
            window.location.hash = encodeURIComponent(u); currentModalUser = u;
            const stats = userMap[u] || [];
            let sumRank = 0; stats.forEach(s => sumRank += s.rank);
            document.getElementById('modalUsername').innerText = u;
            document.getElementById('statWRs').innerText = (globalWRCount[u] || 0) + " WRs";
            document.getElementById('statAvgRank').innerText = "Avg Rank: #" + (stats.length ? (sumRank / stats.length).toFixed(1) : "0");
            document.getElementById('statBoardsPlayed').innerText = "Boards: " + stats.length + "/200";
            renderModalTable(); document.getElementById('userModal').classList.remove('hidden');
        }

        function closeModal() { document.getElementById('userModal').classList.add('hidden'); history.replaceState(null, null, window.location.pathname + window.location.search); }

        function sortModal(col) { if (modalSortCol === col) modalSortDir *= -1; else { modalSortCol = col; modalSortDir = 1; } renderModalTable(); }

        function renderModalTable() {
            const stats = [...userMap[currentModalUser]].sort((a,b) => {
                let d = 0;
                if (modalSortCol === "rounds") d = a.rounds - b.rounds;
                else if (modalSortCol === "timer") d = a.timer - b.timer;
                else if (modalSortCol === "pan") d = a.pan - b.pan;
                else if (modalSortCol === "zoom") d = a.zoom - b.zoom;
                else if (modalSortCol === "move") d = a.move - b.move;
                else if (modalSortCol === "rank") d = a.rank - b.rank;
                else if (modalSortCol === "score") d = a.score - b.score;
                else if (modalSortCol === "time") d = a.time - b.time;
                return (d || (a.rounds - b.rounds)) * modalSortDir;
            });
            const tbody = document.getElementById('modalStatsBody'); tbody.innerHTML = "";
            stats.forEach(s => {
                const tr = document.createElement('tr'); tr.className = "border-b border-white/5 hover:bg-white/5 transition-colors";
                
                const timerStr = getTimerLabel(s.timer);
                const check = (val) => `<div class="setting-check ${val ? 'active' : 'inactive'}"></div>`;

                tr.innerHTML = `
                    <td class="py-4 text-center text-slate-300 font-sans">${s.rounds}</td>
                    <td class="py-4 text-center text-slate-400 font-sans text-xs">${timerStr}</td>
                    <td class="py-4 text-center">${check(s.pan)}</td>
                    <td class="py-4 text-center">${check(s.zoom)}</td>
                    <td class="py-4 text-center">${check(s.move)}</td>
                    
                    <td class="py-4 text-center text-blue-400">#${s.rank}</td>
                    <td class="py-4 text-center text-emerald-400 font-bold">${s.score.toLocaleString()}</td>
                    <td class="py-4 text-right text-slate-500">${formatDuration(s.time)}</td>
                `;
                tbody.appendChild(tr);
            });
            ['rounds','timer','pan','zoom','move','rank','score','time'].forEach(c => {
                const el = document.getElementById('sort-'+c);
                el.innerText = c === modalSortCol ? (modalSortDir === 1 ? 'â–²' : 'â–¼') : ''; el.className = 'sort-icon' + (c === modalSortCol ? ' active-sort' : '');
            });
        }

        window.onclick = e => { if (e.target.id === 'userModal') closeModal(); }
        indexUsers(); updateTable();
        if(window.location.hash) showUserStats(decodeURIComponent(window.location.hash.substring(1)));
    </script>
